import axios from 'axios';

export const getAllProducts = async () => {
  try {
    console.log(await axios.get('http://127.0.0.1:8000/api/product'));
    return await axios.get('http://127.0.0.1:8000/api/product');
  } catch (error) {
    console.log(error);
  }

};
